MODIFY Konvence - description: Konvence


	! dodržovat termíny


	Úkoly zakládá pouze vedoucí týmu, ostatní jenom aktualizují stav (čas, progress, ...)


	Stav úkolu- new = nevyřešený (při nalezení chyby se uzavřený nastaví znova na new)- Accepted = přijatý - probíhá práce na úkolu- resolved = dokončený, stav = 100%- closed = uzavřený


	Zaznamenávat strávený čas a aktivitu, % hotovo, nahrávat na git s odkazem na úkol.Odhadovaný čas po zadaní měnit jen výjimečně (rozdhodně ne po splnění úkolu)!Při commitu dat souvisejících s taskem, provázat commit a task: re #cislo_tasku v komentáři commitu


	Příklad:


	Kód- čitelný, dobře strukturovaný, komentáře (bez diakritiky), kód anglicky- bloky (for,...) vždy se závorkami



/**
* Dokumentacni komentar
*/
void procedure_name() {
  for(int i = 0; i < 10; i++){

  }   

